import React from "react";
import { Link } from "react-router-dom";

const Submit = () => {
    return(
        <div className="submit">
            <h1 style={{fontSize: 65, fontWeight:"lighter"}}>Webform Generated</h1>
            <h3 style={{fontWeight:"lighter", color: '#777', fontSize: 35}}>Your custom form will be stored in our database and visible to other users.</h3>
            <h4 style={{fontWeight:"lighter", color: '#777', fontSize: 17}}>Here's the finalized design and source code:</h4>
            <br /><br /><br /><br /><Link to="/" style={{textDecoration: 'none', color: '#888' }}>
                Return to Homepage
                </Link>
        </div>
        
    );
}

export default Submit
